import React from "react";
import styled from "styled-components";
import { BrandLogo } from "../brandLogo";

const FooterContainer = styled.div`
    width: 100%;
    min-height:100%;
    display:flex;
    flex-direction:column;
    justify-content:space-between;
    padding: 2em 3em 0em;
    border-top: 0.6px solid #000;
`;

const OneMoreContainer = styled.div`
    display:flex;
    justify-content:space-around;

`;

const TopContainer = styled.div`
    width: 100%;
    display:flex;
`;

const ContentContainer = styled.div`
    display:flex;
    flex-direction:column;
    align-items: flex-start;
    &:not(:last-of-type){
        margin-right: 2%;
    }
`;

const BottomContainer = styled.div`
    height: 70px;
    display:flex;
    justify-content: space-between;
    border-top: 0.6px solid #000;
    padding: 0 10px;
`;

const RightBottomContainer = styled.div`
    display: flex;
`;

const LeftBottomContainer = styled.div`
    display:flex;
`;

const Title = styled.h2`
    margin:0 0 8px 0;
    color: #000;
    font-weight:700;
    font-size: 24px;
`;

const FLink = styled.a`
    text-decoration:none;
    color: #6F6F6F;
    font-weight: 500;

    &:not(:last-of-type){
        margin: 0 0 5px 0;
    }
`;

export function Footer(props){
    return(
        <FooterContainer>
            <OneMoreContainer>
            <ContentContainer>
                <Title>Categories</Title>
                <FLink>Dogs</FLink>
                <FLink>Cats</FLink>
                <FLink>Dog Walking</FLink>
                <FLink>House Sitting</FLink>
                <FLink>Drop In Services</FLink>
                <FLink>Doggy Daycare</FLink>
            </ContentContainer>
            <ContentContainer>
                <Title>Access</Title>
                <FLink>Login</FLink>
                <FLink>Join Us</FLink>
                <FLink>Login As Specialist</FLink>
                <FLink>Become A Specialist</FLink>
            </ContentContainer>
            </OneMoreContainer>
            <BottomContainer>
                <LeftBottomContainer>
                    <BrandLogo size="20" textSize={16}/>
                </LeftBottomContainer>
                <RightBottomContainer>
                    Icons
                </RightBottomContainer>
            </BottomContainer>
        </FooterContainer>

    );
}
